		EAB893692E3A9A2400B1C72A /* Copy App Icons */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			files = (
			);
			inputFileListPaths = (
			);
			inputPaths = (
			);
			name = "Copy App Icons";
			outputFileListPaths = (
			);
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "echo \"Processing app icons...\"\n\n# Debug info\necho \"BUILT_PRODUCTS_DIR: ${BUILT_PRODUCTS_DIR}\"\necho \"PRODUCT_NAME: ${PRODUCT_NAME}\"\necho \"SRCROOT: ${SRCROOT}\"\necho \"CONFIGURATION: ${CONFIGURATION}\"\n\n# Determine the app path\nAPP_PATH=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app\"\necho \"APP_PATH: ${APP_PATH}\"\n\n# First, manually compile the asset catalog\necho \"Compiling asset catalog...\"\nxcrun actool \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets\" \\\n    --compile \"${APP_PATH}\" \\\n    --platform iphoneos \\\n    --minimum-deployment-target ${IPHONEOS_DEPLOYMENT_TARGET} \\\n    --app-icon AppIcon \\\n    --output-partial-info-plist \"${BUILT_PRODUCTS_DIR}/AssetCatalogInfo.plist\" \\\n    --compress-pngs \\\n    --enable-on-demand-resources NO \\\n    --target-device iphone \\\n    --target-device ipad\n\n# Always copy icons manually to ensure they're present\necho \"Copying icons manually...\"\n\n# Copy 120x120 icon with various names that App Store might look for\nif [ -f \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/Icon-App-60x60@2x.png\" ]; then\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/Icon-App-60x60@2x.png\" \"${APP_PATH}/AppIcon60x60@2x.png\"\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/Icon-App-60x60@2x.png\" \"${APP_PATH}/AppIcon60x60@2x~iphone.png\"\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/Icon-App-60x60@2x.png\" \"${APP_PATH}/Icon-60@2x.png\"\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/Icon-App-60x60@2x.png\" \"${APP_PATH}/Icon-120.png\"\n    echo \"✓ Copied 120x120 icon\"\nfi\n\n# Copy all icons to app bundle\nfor icon in \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/\"*.png; do\n    if [ -f \"$icon\" ]; then\n        filename=$(basename \"$icon\")\n        cp \"$icon\" \"${APP_PATH}/$filename\"\n    fi\ndone\n\n# Copy 1024x1024 marketing icon\nif [ -f \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/ItunesArtwork@2x.png\" ]; then\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/ItunesArtwork@2x.png\" \"${APP_PATH}/iTunesArtwork@2x.png\"\n    cp \"${SRCROOT}/Paws-n-Us/Resources/Assets.xcassets/AppIcon.appiconset/ItunesArtwork@2x.png\" \"${APP_PATH}/../iTunesArtwork@2x.png\" || true\n    echo \"✓ Copied 1024x1024 marketing icon\"\nfi\n\n# Check if Assets.car was created\nif [ -f \"${APP_PATH}/Assets.car\" ]; then\n    echo \"✓ Assets.car created\"\nelse\n    echo \"⚠️  Assets.car not found\"\nfi\n\necho \"Icon processing complete\"\n";
		};
